 class Node {
    int data;
    Node next;

    public Node(int data) {
        this.data = data;
        this.next = null;
    }
}

class LinkedList {
    private Node head;

    // Add a new node at the beginning
    public void addFirst(int data) {
        Node newNode = new Node(data);
        newNode.next = head;
        head = newNode;
    }

    // Add a new node at the end
    public void addLast(int data) {
        Node newNode = new Node(data);
        if (head == null) {
            head = newNode;
            return;
        }
        Node current = head;
        while (current.next != null) {
            current = current.next;
        }
        current.next = newNode;
    }

    // Delete the first node
    public void deleteFirst() {
        if (head != null) {
            head = head.next;
        }
    }

    // Delete the last node
    public void deleteLast() {
        if (head == null || head.next == null) {
            head = null;
            return;
        }
        Node current = head;
        while (current.next.next != null) {
            current = current.next;
        }
        current.next = null;
    }

    // Search for a node with specific data
    public boolean search(int key) {
        Node current = head;
        while (current != null) {
            if (current.data == key) {
                return true;
            }
            current = current.next;
        }
        return false;
    }

    // Print the linked list
    public void printList() {
        Node current = head;
        while (current != null) {
            System.out.print(current.data + " -> ");
            current = current.next;
        }
        System.out.println("null");
    }
}

public class Main {
    public static void main(String[] args) {
        LinkedList list = new LinkedList();

        // Add elements to the list
        list.addFirst(10);
        list.addFirst(20);
        list.addLast(30);
        list.addLast(40);

        // Print the list
        list.printList();  // Output  20 -> 10 -> 30 -> 40 -> null

        // Search for an element
        System.out.println(list.search(30));  // Output  true
        System.out.println(list.search(50));  // Output  false

        // Delete elements from the list
        list.deleteFirst();
        list.printList();  // Output 10 -> 30 -> 40 -> null

        list.deleteLast();
        list.printList();  //10 -> 30 -> null
    }
}
